function redirectToView(n,t,i){location.href=`${n}/${t}?id=${i}`}function EnbleAddressEdit(n){document.getElementById(`city_${n}`).disabled=!1;document.getElementById(`street_${n}`).disabled=!1}function DeleteCustomer(n){$.ajax({type:"POST",url:`https://${location.host}/api/Customer/Delete`,contentType:"application/json",dataType:"json",data:JSON.stringify({Id:n}),success:function(n){console.log(n)},error:function(n,t,i){console.error(n);console.log(t);console.log(i)}})}function DeleteAddress(n){$.ajax({type:"POST",url:`https://${location.host}/api/Address/Delete`,contentType:"application/json",dataType:"json",data:JSON.stringify({Id:n}),success:function(n){console.log(n)},error:function(n,t,i){console.error(n);console.log(t);console.log(i)}})}function SaveAddressChanges(n){let t=document.getElementById(`city_${n}`).value,i=document.getElementById(`street_${n}`).value;$.ajax({type:"POST",url:`https://${location.host}/api/Address/UpdateAddress`,contentType:"application/json",dataType:"json",data:JSON.stringify({Id:n,City:t,Street:i}),success:function(n){console.log(n);location.reload()},error:function(n,t,i){console.error(n);console.error(t);console.error(i)}})}function EnbleCustomerEdit(){document.getElementById("customerName").disabled=!1;document.getElementById("customerNumber").disabled=!1}function EnbleContactEdit(n){document.getElementById(`fullname_${n}`).disabled=!1;document.getElementById(`officenumber_${n}`).disabled=!1;document.getElementById(`email_${n}`).disabled=!1}function IsValidCustomerNumber(n){if(n!=""&&n.length==9){for(let t=0;t<n.length;t++)if(!(n[t]>="0"&&n[t]<="9"))return!1;return!0}return!1}function SaveCustomerChanges(n){let t=document.getElementById("customerName").value,i=document.getElementById("customerNumber").value;$.ajax({type:"POST",url:`https://${location.host}/api/Customer/UpdateCustomer`,contentType:"application/json",dataType:"json",data:JSON.stringify({Id:n,CustomerNumber:i,Name:t}),success:function(n){console.log(n);location.reload()},error:function(n,t,i){console.error(n);console.error(t);console.error(i)}})}function SaveContactChanges(n){let t=document.getElementById(`fullname_${n}`).value,i=document.getElementById(`officenumber_${n}`).value,r=document.getElementById(`email_${n}`).value;$.ajax({type:"POST",url:`https://${location.host}/api/Contact/UpdateContact`,contentType:"application/json",dataType:"json",data:JSON.stringify({Id:n,FullName:t,Email:r,OfficeNumber:i}),success:function(n){console.log(n);location.reload()},error:function(n,t,i){console.error(n);console.error(t);console.error(i)}})}function CreateCustomer(){let t=document.getElementById("newCustomer_name").value,n=document.getElementById("newCustomer_customerNumber").value;$.ajax({type:"POST",url:`https://${location.host}/api/Customer/IsCustomerExist`,contentType:"application/json",dataType:"json","async":!1,data:JSON.stringify({CustomerNumber:n}),success:function(i){if(console.log(i),i.result){alert("Customer already exist");return}CreateCustomerAjax(t,n)},error:function(n,t,i){console.error(n);console.error(t);console.error(i)}})}function CreateCustomerAjax(n,t){let i=document.getElementById("newCustomer_city").value,r=document.getElementById("newCustomer_street").value,u=[{City:i,Street:r}],f=document.getElementById("newCustomer_contact_fullname").value,e=document.getElementById("newCustomer_contact_officenumber").value,o=document.getElementById("newCustomer_contact_email").value,s=[{FullName:f,OfficeNumber:e,Email:o}];$.ajax({type:"POST",url:`https://${location.host}/api/Customer/CreateCustomer`,contentType:"application/json",dataType:"json",data:JSON.stringify({Name:n,CustomerNumber:t,Addresses:u,Contacts:s}),success:function(n){console.log(n);location.reload()},error:function(n,t,i){console.error(n);console.error(t);console.error(i)}})}